CREATE TABLE `hosts` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `zone` varchar(255) DEFAULT NULL,
  `hostname` varchar(100) DEFAULT NULL,
  `port` int(11) DEFAULT NULL,
  `username` varchar(50) DEFAULT NULL,
  `pkey` longtext,
  `comment` varchar(255) DEFAULT NULL,
  `created_at` varchar(20) NOT NULL,
  `coreVerion` varchar(100) DEFAULT NULL,
  `cpus` int(11) DEFAULT NULL,
  `create_by_id` int(11) NOT NULL,
  `developer` varchar(200) DEFAULT NULL,
  `disks` int(11) DEFAULT NULL,
  `env_id` int(11) DEFAULT NULL,
  `ipaddress` varchar(255) DEFAULT NULL,
  `memory` int(11) DEFAULT NULL,
  `modify_time` datetime(6) NOT NULL,
  `opsper` varchar(200) DEFAULT NULL,
  `osType` varchar(155) DEFAULT NULL,
  `osVerion` varchar(100) DEFAULT NULL,
  `service_pack` varchar(500) DEFAULT NULL,
  `status` int(11) DEFAULT NULL,
  `supplier` varchar(100) DEFAULT NULL,
  `top_project` varchar(180) DEFAULT NULL,
  `disk` longtext,
  `deleted_at` varchar(20) DEFAULT NULL,
  `deleted_by_id` int(11) DEFAULT NULL,
  `iprelease` varchar(15) DEFAULT NULL,
  `outter_ip` varchar(255) DEFAULT NULL,
  `provider` int(11) DEFAULT NULL,
  `resource_type` varchar(50) DEFAULT NULL,
  `use_for` varchar(255) DEFAULT NULL,
  `v_ip` varchar(255) DEFAULT NULL,
  `work_zone` varchar(20) DEFAULT NULL,
  `ostp` varchar(100) DEFAULT NULL,
  `password_date` datetime(6) DEFAULT NULL,
  `password_hash` longblob,
  `password_expire` int(11) DEFAULT NULL,
  `data_disk` longtext,
  `sys_disk` varchar(255) DEFAULT NULL,
  `child_project` varchar(180) DEFAULT NULL,
  `cluster` varchar(100) DEFAULT NULL,
  `sys_data` varchar(500) DEFAULT NULL,
  `shili` varchar(500) DEFAULT NULL,
  `dbrelation` int(11) DEFAULT NULL,
  `dbtag` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `hosts_create_by_id_5cd9f6b4_fk_users_id` (`create_by_id`),
  KEY `hosts_env_id_056fac67_fk_environments_id` (`env_id`),
  KEY `hosts_modify_time_dad96050` (`modify_time`),
  KEY `hosts_deleted_by_id_2e0163c8_fk_users_id` (`deleted_by_id`),
  CONSTRAINT `hosts_create_by_id_5cd9f6b4_fk_users_id` FOREIGN KEY (`create_by_id`) REFERENCES `users` (`id`),
  CONSTRAINT `hosts_deleted_by_id_2e0163c8_fk_users_id` FOREIGN KEY (`deleted_by_id`) REFERENCES `users` (`id`),
  CONSTRAINT `hosts_env_id_056fac67_fk_environments_id` FOREIGN KEY (`env_id`) REFERENCES `environments` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=4775 DEFAULT CHARSET=utf8;
