w==)\\n    password: ENC(8c9hFB1LjCmDl5HLKJ/7hS31/Mhgugb2)\\n    type: com.alibaba.druid.pool.DruidDataSource\\n    #    hikari:\\n    #      minimum-idle: 1\\n    #      maximum-pool-size: 20\\n    druid:\\n      initial-size: 5\\n      max-active: 100\\n      min-idle: 5\\n      max-wait: 30000 #配置获取连接等待超时的时间\\n      # 是否缓存preparedStatement，也就是PSCache。PSCache对支持游标的数据库性能提升巨大，比如说oracle。在mysql下建议关闭\\n      pool-prepared-statements: true\\n      max-pool-prepared-statement-per-connection-size: 20\\n      max-open-prepared-statements: 20 #和上面的等价\\n      validation-query: SELECT \'x\' FROM DUAL\\n      validation-query-timeout: 1\\n      test-on-borrow: true\\n      test-on-return: true\\n      test-while-idle: true\\n      filters: stat\\n    # 数据集成库MySQL\\n    imploded:\\n      driver-class-name: com.kingbase8.Driver\\n      url: jdbc:kingbase8://19.104.52.136:54321/dmp?useUnicode=true&characterEncoding=utf-8&useSSL=false\\n      username: ENC(3n3oDyhExIkYaqO909oLrQ==)\\n      password: ENC(9gfPKdnr7no/HpaUpp4hjHF3vmOa/7wL)\\n    # 网关oracle库\\n    gateway:\\n      driver-class-name: com.kingbase8.Driver\\n      url: jdbc:kingbase8://19.104.52.128:54321/DATALAKE\\n      username: ENC(WbBm/saDE89kcMhiA5tr5w==)\\n      password: ENC(8c9hFB1LjCmDl5HLKJ/7hS31/Mhgugb2)\\n      \\n  jpa:\\n    show-sql: false\\n    database-platform: org.hibernate.dialect.Kingbase8Dialect\\n  redis:\\n    # redis数据库索引（默认为0），我们使用索引为3的数据库，避免和其他数据库冲突\\n    database: 0\\n    # redis服务器地址（默认为localhost）\\n    host: 19.104.50.204\\n    # redis端口（默认为6379）\\n    port: 6379\\n    # redis访问密码（默认为空）\\n    password: ENC(KPABNLQtx1Nsg8UCWxgGETtvznhDkMa4)\\n    # redis连接超时时间（单位为毫秒）\\n    timeout: 50000\\n    # redis连接池配置\\n    lettuce:\\n      pool:\\n        # 最大可用连接数（默认为8，负数表示无限）\\n        max-active: 8\\n        # 最大空闲连接数（默认为8，负数表示无限）\\n        max-idle: 8\\n        # 最小空闲连接数（默认为0，该值只有为正数才有作用）\\n        min-idle: 0\\n        # 从连接池中获取连接最大等待时间（默认为-1，单位为毫秒，负数表示无限）\\n        max-wait: 5000\\n\\n  kafka:\\n    #消费者配置\\n    consumer:\\n      bootstrap-servers: kafka.kafka-ns:9092 #kafka服务器地址 多个以,号隔开\\n      group-id: DATALAKE #消费者分组id,同一个分组的消费者不会读取到同一个消息\\n      enable-auto-commit: false #启用自动提交偏移量\\n      #auto-commit-interval: 100 #设置偏移量提交间隔\\n      max-poll-records: 3 #最大批量读取条数\\n    #生产者配置\\n    producer:\\n      #bootstrap-servers: 19.104.50.123:9091,19.104.50.123:9092,19.104.50.123:9093 \\n      bootstrap-servers:  kafka.efk:9092 \\n#kafka服务器地址 多个以,号隔开\\n      batch-size: 16384  #每次批量发送信息的数量\\n      buffer-memory: 33554432 #达到该缓冲区大小就发送数据\\n      linger-ms: 5000 #最多等待多长时间\\n\\n  servlet:\\n    multipart:\\n      max-file-size: 50MB\\n      max-request-size: 100MB\\n\\nljdp:\\n  ftpserver:\\n    url: 19.104.40.34\\n    port: 21\\n    mode: PASV\\n    username: nanjian\\n    password: iocplatform@0769\\n    remote-path: /\\n    local-temp-path: /tmp\\n  dfs:\\n    ftp2http-proxy: http://19.104.50.204/iocadminsvc/ftp\\n    ftp2http-download: http://19.104.50.204/iocadminsvc/ljdp/dfs/downloadByFid.act?fid=\\n  fileupload:\\n    # 覆盖batch.fileupload.path配置\\n    local-path: /data/file\\n  security:\\n    api:\\n      skey: ENC(U9gx2By8DaCRK/VM7SgZfFluZy8G7InNSmJvTnI8LEDxL8GSns8dVWZJ0cHm6mY2)\\n  minio:\\n    endpoint: http://19.104.50.77:9004\\n    access-key: ENC(XjSNYyGJ/xkMUx5Kh9Bgsw==)\\n    secret-key: ENC(P87kJGkELbF29U30+jxSYRV9Ruc7ro3bze0VwDQXkwY=)\\n    download-proxy: /admin/dfs/objectcatalog/download?objectkey=\\n\\niocplatform:\\n  url:\\n    ioc-admin: http://ioc-admin-svc.ioc-platform:8080\\n    # rootId\\n    admin-depart-root-id: 764c858f-42a0-4a2e-8f84-9a5abec2f772\\n    # 查询此ID下的子机构\\n    admin-depart-get-child: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doSubset?orgid=\\n    # 根据ID获取\\n    admin-depart-get: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/{id}\\n    # [树]获取所有组织\\n    admin-depart-get-tree: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doZTreeToElement\\n    # 顶级部门\\n    admin-depart-top-dept: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doTopDepartment?id={orgid}\\n    # login接口\\n    admin-user-login: ${iocplatform.url.ioc-admin}/admin/user/sysUser/login\\n    # 根据orgType查询组织机构\\n    orgtype-get-depart: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/search?eq_orgtype={eq_orgtype}&page={page}&size={size}\\n    # 获取ZTree （充当全树使用）\\n    admin-depart-ztree: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doZTree\\n    # 根据组织机构和角色查询用户列表\\n    org-role-get-users: ${iocplatform.url.ioc-admin}/admin/user/sysUser/searchUsersByOrgAndRole?orgid={orgid}&deptcode={deptcode}&roleAlias={roleAlias}\\n    # 账号\\n    user-account: ENC(n7PmuK9NJNgwwYgkOnhsvAH/N07BHVc6)\\n    #密码\\n    user-pwd: ENC(n7PmuK9NJNgwwYgkOnhsvAH/N07BHVc6)\\n    # 跨局的附件下载的网关地址\\n    file-download-gateway:\\n      # 这里的url要用外网的地址，不能用服务名的方式\\n      url: https://19.104.50.204\\n      #通过附件下载的网关地址来下载附件：{0}需要下载的某局附件的局编码、{1}需要下载的附件id\\n      download-path: ${iocplatform.url.file-download-gateway.url}/dmp/{0}/datatransferweb/admin/dfs/objectcatalog/download?objectkey={1}\\n      minio-download-path: ${iocplatform.url.file-download-gateway.url}/dmp/{0}/datalakeweb/{1}\\n\\ndatalake:\\n  # 获取全局唯一ID接口\\n  sequence:\\n    # 是否开启安全校验（JWT）\\n    security-mode: false\\n    # key\\n    key: datalakeseq\\n    # secret\\n    secret: B6CZm99aVcHUsabTCm1u\\n    #  global-unique-id配置样例（最后要加/）：http://127.0.0.1:8081/sequence/getSequenceNumber/\\n    global-unique-id: http://ioc-sequence-svc:8081/sequence/getSequenceNumber/\\n    # 若安全模式开启，则调用下面URL（datalake.sequence.global-unique-id失效）\\n    global-unique-id-on-security: http://ioc-sequence-svc:8081/sequence/getSequenceNumber/\\n  ui:\\n    url:\\n      ip-port: https://19.104.50.204\\n      # 数据湖前端订阅页面，用于给数据集跳转\\n      audit-page: ${datalake.ui.url.ip-port}/datalakeweb/res-manage/take/{resourceId}/{resourceType}\\n  svc:\\n    #  服务请求地址\\n    url: http://ioc-datalake-svc:8080\\n    api:\\n      # 刷新机构树\\n      refresh-orgTree: ${datalake.svc.url}/datalake/organization/refreshResourceAmountAboutOrg\\n      # 定时统计库表挂载数据量\\n      count-mount-data-size: ${datalake.svc.url}/datalake/statistics/countDataSize\\n      # 定时保存目录分类/标签关系到主湖\\n      # 省-定时数据关联\\n      get-to-push-mount-data: ${datalake.svc.url}/datalake/resource/getToPushMountData\\n      # 省-数据关联（挂载）\\n      province_push-mount: ${datalake.svc.url}/datalake/resource/provincePushMount/\\n      save-relation: ${datalake.svc.url}/datalake/rescataTagLabelRelation/produceSysDatalakeRelation\\n  # 数据库类型（主湖：PostgreSQL；子湖：Oracle）\\n  database-type: PostgreSQL\\n  # 内网生产环境的PostgreSQL是华为的，改属性需要设置为true，建表语句将会设置“分布式列”\\n  is-cluster: true\\n\\niocpaas:\\n  url:\\n    ioc-paas: http://ioc-paas-svc.ioc-platform:8080\\n    # 推送智能API查询接口信息到网关平台\\n    iocpaas-syncCustomApi: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi\\n    # 网关平台-获取API凭证\\n    iocpaas-CustomApiCredential: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/getCustomApiCredential\\n    # 通过token获取token用户信息\\n    iocpaas-token-user-get: ${iocpaas.url.ioc-paas}/certificate/api/spApiCredential/decodeToken\\n    # 获取网关代理地址\\n    gateway-ipport: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/getKongProxy\\n    # 根据token获取用户信息\\n    iocpaas-decodeToken: ${iocpaas.url.ioc-paas}/certificate/api/spApiCredential/decodeToken\\n    # 同步删除网关API接口\\n    sync-deleteApi: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/{moduleType}/{customApiId}\\n    # 获取网关API凭证和aes秘钥和偏移量\\n    iocpass-spDlResJwt: ${iocpaas.url.ioc-paas}/certificate/spDlResJwt/{resourceCode}\\n    # 同步更新第三方API的局与科室信息\\n    gateway-syncCustomApiDept: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApiDept\\n    # api共享到市场\\n    iocpass-api-publish: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/publish\\n    # api从市场下架\\n    iocpass-api-unpublish: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/unpublish\\n\\n# 汇聚平台\\ndts:\\n  integration:\\n    # 数据源相关\\n    datasource:\\n      url: http://ioc-dts-integrat-svc.ioc-platform.svc:8080\\n      # 根据数据库类型， 查询数据库\\n      search: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/search?\\n      # 根据数据库， 查询表\\n      get-table-list: ${dts.integration.datasource.url}/dts/integration/dataLake/queryTableAndViewList?\\n      # 根据表， 查询字段\\n      get-column-list: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getColumnList?\\n      # 统计表的数据量（select count(1) from table）\\n      count-by-table: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getTableDataRows?\\n      # 备库数据资产统计结果\\n      result-search: ${dts.integration.datasource.url}/dts/integration/statistic/dtsStatisticsResult/search?\\n      # 根据资源目录编码获取任务信息\\n      get-task-info: ${dts.integration.datasource.url}/dts/job/getDtsJobByResourceCode?\\n      # 根据数据源ID和表名，分页查询表数据\\n      query-table-data: ${dts.integration.datasource.url}/dts/integration/dataLake/findTableData?\\n      # 通过数据源ID获取加密后的JDBC链接信息\\n      get-dataSource-connInfo: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getById/{id}\\n      # 根据表名获取时序值本源值(数字)\\n      query-doSeqNumber: ${dts.integration.datasource.url}/dts/integration/dtsTableSeq/doSeqNumber\\n      # 根据表名更新时序数\\n      update-doSeqNumber: ${dts.integration.datasource.url}/dts/integration/dtsTableSeq/updateSeq\\n    # 站内信相关\\n    message:\\n      # 保存站内信\\n      save-internal-message: ${dts.integration.datasource.url}/dts/integration/dtsMessage\\n\\nkafka:\\n  topic1: datalake-topic1 #kafka事件发布\\n  topic2: datalake-topic2 #kafka事件处理\\n\\n# 是否本地开发环境\\ndev:\\n  devFlag: false\\n\\nschedule:\\n  ibus:\\n    table-scan: 0 0 20 * * ?\\n  execution:\\n    waitqueue: 0/5 * * * * ?\\n  require-work-order:\\n    statistics: 0 0 0/6 * * ?\\n  # 数据资产统计 10分钟一次\\n  data-asset-statistics: 0 0/10 * * * ?\\n  # 监听推送 5秒一次\\n  push-lister: 0/5 * * * * ?\\n  #库表挂载数据量统计,每天执行一次\\n  count-mount-data-statistics: 0 0 0 1/1 * ?\\n  #数据资产统计\\n  # 资源目录信息统计 30秒一次\\n  resource-statistics: 0/30 * * * * ?\\n  # 组织机构表资源目录数量统计，二分钟一次\\n  organization-resource-statistics: 0 0/2 * * * ?\\n  require-work-order.statistics: 0/30 * * * * ?\\n  heart_bead_update: 0/30 * * * * ?\\n  # 首页统计数据\\n  indexStatistics:\\n    DataResourceJob: 0 0 2 * * ?\\n    IndexStatisticsJob: 0 10 4 * * ?\\n    MoodAndUpdateCycleStatisticsJob: 0 20 4 * * ?\\n    MyTaskJob: 0 30 1 * * ?\\n    PostgreJob: 0 40 4 * * ?\\n    RescataJob: 0 50 4 * * ?\\n    TenantryIndexStatisticsJob: 0 5 4 * * ?\\n    TenantryMoodAndUpdateCycleStatisticsJob: 0 15 4 * * ?\\n    TenantryMyTaskJob: 0 25 1 * * ?\\n    TenantryRescataJob: 0 35 2 * * ?\\n    TenantryDataResourceJob: 0 45 2 * * ?\\n  # 首页统计数据发MQ\\n  indexPushMq: 0 30 4/2 * * ?\\n  # 获取dts标准库表记录数\\n  callCheckCenterTableData: 0 15 * * * ?\\n  ConvergeDataPushJob: 0 0 1 * * ?\\n  datasource-alarm: 0 0 9 * * ?\\n  ApiJob: 0 30 5 * * ?\\n  checkDatabaseTableColumnJob: 0 5 0/6 * * ?\\n  # 定时保存目录分类/标签关系到主湖\\n  save-relation: 0 0 0 1/1 * ?\\n  # 省推送数据关联（目录挂载） 每10分钟查询一次\\n  provincePushMountJob: 0 0/5 * * * ?\\n  TenantToMainJob:\\n   # 先做汇集工作，再做统计工作\\n   doAllMerge: 0 30 15-22 * * ?\\n   doStatistics: 0 45 15-22 * * ?\\n\\nsubSite:\\n  #心跳接收监控端口\\n  serverHbPort: 20000\\n  #多久没有检测到心跳设置不健康，单位分钟\\n  timeout: 1\\n\\ndept:\\n  name: 东莞市政务服务数据管理局\\n  code: DGS060\\n\\nnotice:\\n  #短信发送\\n  msg:\\n    url: http://19.104.8.6/mspf/servlet/SpInterface\\n    sp-id: 112\\n    password: ENC(A0bJTsH6nBUvTZ58C+vmTw==)\"}]','ioc-platform','ioc-platform','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-job-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-job-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-job-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-job-conf/yaml','ioc',1,'https://rancher.ioc.com/p/local:p-8v6qj/config-maps/ioc-platform:ioc-datalake-job-conf','ioc-platform','2022-01-27 15:45:32.176553','2022-01-27 15:45:32.181585'),(30,'loca