rnance\\n\\nkafka:\\n  topic1: datalake-topic1 #kafka事件发布\\n  topic2: datalake-topic2 #kafka事件处理\\n\\n#计划任务配置\\nschedule:\\n  execution:\\n    waitqueue: 0/5 * * * * ?\\n  require-work-order:\\n    statistics: 0 0 0 * * ?\\n  # 数据资产统计 10分钟一次\\n  data-asset-statistics: 0 0/10 * * * ?\\n  # 资源目录信息统计 两小时一次\\n  resource-statistics: 0 0 0/2 * * ?\\n  # 组织机构表资源目录数量统计，两小时一次\\n  organization-resource-statistics: 0 0 0/2 * * ?\\n  # 监听推送 5秒一次\\n  push-lister: 0/5 * * * * ?\\n\\n#RabbitMQ消息存活时间:一周\\nrabbitmqMsg:\\n  message-ttl: 604800000\\n# RabbitMQ组件的使用帮助类配置信息\\nrabbitmqhelp:\\n  sendMsg: true\\n  base:\\n    # mq是否注册\\n    rabbitmq-signIn: true\\n    # 管理端（政数局）的服务名称的缩写\\n    admin-service-short-name: DGS060\\n    # 当前服务是否是管理端\\n    current-service-is-Admin: true\\n    # 当前服务名称的缩写 东莞市政务服务数据管理局 DGS060\\n    current-service-short-name: DGS060\"}]','ioc-platform','ioc-platform','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-kafka-consumer-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-kafka-consumer-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-kafka-consumer-conf','https://rancher.ioc.com/v3/project/local:p-8v6qj/configMaps/ioc-platform:ioc-datalake-kafka-consumer-conf/yaml','ioc',1,'https://rancher.ioc.com/p/local:p-8v6qj/config-maps/ioc-platform:ioc-datalake-kafka-consumer-conf','ioc-platform','2022-01-27 15:45:32.191208','2022-01-27 15:45:32.195640'),(31,'local:p-8v6qj','ioc-platform:ioc-datalake-svc-conf','ioc-datalake-svc-conf','[{\'k\': \'application-govprod.yml\', \'v\': \'# 开发环境配置\\ndebug: false\\nserver:\\n  port: 8080 #tomcat运行端口\\n  servlet:\\n    context-path: /\\n\\n#mybatis:\\n#  config-location: classpath:mybatis-config.xml\\n#  typeAliasesPackage: com.openjava.example.mybatis.domain\\n#  mapperLocations:\\n#    -classpath:com.openjava.example.*.mapper/*.xml\\n\\nspring:\\n  application:\\n    name: datalake_prometheus\\n  dataso