nger-ms: 5000 #最多等待多长时间\\n\\n  servlet:\\n    multipart:\\n      max-file-size: 50MB\\n      max-request-size: 100MB\\n  jpa:\\n    show-sql: false\\n    properties:\\n       hibernate:\\n         session_factory:\\n            statement_inspector: org.openjava.boot.conf.JpaInterceptor\\n  # rabbitmq\\n  rabbitmq:\\n    host: 19.104.53.216\\n    port: 5672\\n    username: ENC(Yod5n68YX6daptfA2SPSyA==)\\n    password: ENC(Opv5Vj/1Zs2/CZGOLKReesdKfIUiPSMwMHn1rcETjWA=)\\n    virtual-host: /\\n    #开启消息发送确认\\n    publisher-confirms: true\\n    #开启ReturnCallback,如果消息从交换器发送到对应队列失败时触发\\n    publisher-returns: true\\n    # 是否启动监听\\n    startListen: true\\n    listener:\\n      simple:\\n        #消费者接收确认\\n        acknowledge-mode: manual\\n        #消费者一次接收多少条消息\\n        prefetch: 3\\n        missing-queues-fatal: false\\n\\nljdp:\\n  ftpserver:\\n    url: 19.104.40.34\\n    port: 21\\n    mode: PASV\\n    username: ENC(i+I7JLbKIqxNMm//V2fFUg==)\\n    password: ENC(M3Bx/lIJSPoJ+k7hFxy9zHvGoyhpXgvwEfp+7A1RQ34=)\\n    remote-path: /\\n    local-temp-path: /tmp\\n  dfs:\\n    ftp2http-proxy: http://19.104.50.204/iocadminsvc/ftp\\n    ftp2http-download: http://19.104.50.204/iocadminsvc/ljdp/dfs/downloadByFid.act?fid=\\n    ftp2http-upload: http://19.104.50.204/iocadminsvc/ljdp/attach/memory/upload.act?busiPath=\\n  fileupload:\\n    # 覆盖batch.fileupload.path配置\\n    local-path: /data/file\\n  security:\\n    api:\\n      # skey: ENC(U9gx2By8DaCRK/VM7SgZfFluZy8G7InNSmJvTnI8LEDxL8GSns8dVWZJ0cHm6mY2)\\n      skey: ENC(U9gx2By8DaCRK/VM7SgZfFluZy8G7InNSmJvTnI8LEDxL8GSns8dVWZJ0cHm6mY2)\\n  minio:\\n    endpoint: http://19.104.50.77:9004\\n    access-key: ENC(XjSNYyGJ/xkMUx5Kh9Bgsw==)\\n    secret-key: ENC(P87kJGkELbF29U30+jxSYRV9Ruc7ro3bze0VwDQXkwY=)\\n    download-proxy: /admin/dfs/objectcatalog/download?objectkey=\\n\\niocplatform:\\n  url:\\n    ioc-admin: http://ioc-admin-svc.ioc-platform:8080\\n    # rootId\\n    admin-depart-root-id: 764c858f-42a0-4a2e-8f84-9a5abec2f772\\n    # 查询此ID下的子机构\\n    admin-depart-get-child: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doSubset?orgid=\\n    # 根据ID获取\\n    admin-depart-get: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/{id}\\n    # [树]获取所有组织\\n    admin-depart-get-tree: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doZTreeToElement\\n    # 顶级部门\\n    admin-depart-top-dept: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doTopDepartment?id={orgid}\\n    # login接口\\n    admin-user-login: ${iocplatform.url.ioc-admin}/admin/user/sysUser/login\\n    # 根据orgType查询组织机构\\n    orgtype-get-depart: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/search?eq_orgtype={eq_orgtype}&page={page}&size={size}\\n    # 获取ZTree （充当全树使用）\\n    admin-depart-ztree: ${iocplatform.url.ioc-admin}/admin/org/sysOrg/doZTree\\n    # 根据组织机构和角色查询用户列表\\n    org-role-get-users: ${iocplatform.url.ioc-admin}/admin/user/sysUser/searchUsersByOrgAndRole?orgid={orgid}&deptcode={deptcode}&roleAlias={roleAlias}\\n    # 获取文件列表\\n    getFsObjectCatalogs: ${iocplatform.url.ioc-admin}/admin/dfs/objectcatalog/query\\n    # 批量更新\\n    batchFsObjectCatalogs: ${iocplatform.url.ioc-admin}/admin/dfs/objectcatalog/batch\\n    # 获取用户信息\\n    searchOrgUser: ${iocplatform.url.ioc-admin}/admin/user/sysUser/v2/searchOrgUser\\n    # 账号\\n    user-account: ENC(n7PmuK9NJNgwwYgkOnhsvAH/N07BHVc6)\\n    #密码\\n    user-pwd: ENC(n7PmuK9NJNgwwYgkOnhsvAH/N07BHVc6)\\n    # 跨局的附件下载的网关地址\\n    file-download-gateway:\\n      # 这里的url要用外网的地址，不能用服务名的方式\\n      url: https://19.104.50.204\\n      #通过附件下载的网关地址来下载附件：{0}需要下载的某局附件的局编码、{1}需要下载的附件id\\n      download-path: ${iocplatform.url.file-download-gateway.url}/dmp/{0}/datatransferweb/admin/dfs/objectcatalog/download?objectkey={1}\\n      minio-download-path: ${iocplatform.url.file-download-gateway.url}/dmp/{0}/datalakeweb/{1}\\n    #附件下载地址（接口中调用）\\n    file-download: ${iocplatform.url.ioc-admin}/admin/dfs/objectcatalog/download?objectkey={0}\\n    \\ndatalake:\\n  # 获取全局唯一ID接口\\n  sequence:\\n    # 是否开启安全校验（JWT）\\n    security-mode: false\\n    # key\\n    key: datalakeseq\\n    # secret\\n    secret: B6CZm99aVcHUsabTCm1u\\n    #  global-unique-id配置样例（最后要加/）：http://127.0.0.1:8081/sequence/getSequenceNumber/\\n    global-unique-id: http://ioc-sequence-svc:8081/sequence/getSequenceNumber/\\n    # 若安全模式开启，则调用下面URL（datalake.sequence.global-unique-id失效）\\n    global-unique-id-on-security: http://ioc-sequence-svc:8081/sequence/getSequenceNumber/\\n  ui:\\n    url:\\n      ip-port: https://19.104.50.204\\n      # 数据湖前端订阅页面，用于给数据集跳转\\n      audit-page: ${datalake.ui.url.ip-port}/datalakeweb/res-manage/take/{resourceId}/{resourceType}\\n  svc:\\n    api:\\n      # 后端提交接口RequestMapping 统一请求地址用apiCode区分\\n      apisync: /\\\\S+/datalake/apisync/resource/{apiCode}\\n  # 数据库类型（主湖：PostgreSQL；子湖：Oracle）\\n  database-type: PostgreSQL\\n  # 内网生产环境的PostgreSQL是华为的，改属性需要设置为true，建表语句将会设置“分布式列”\\n  is-cluster: true \\n  is-hash: true\\n  is-assist-mpp2000: false\\n  ioc-admin:\\n    url: http://ioc-admin-svc:8080\\n    # 从主湖获取所有资源目录分类（用于资源目录分类全量数据同步）\\n    get-full-rescata-cates: ${datalake.ioc-admin.url}/datalakeweb/datalake/rescataCateManage/getAllForFullSync\\n\\niocpaas:\\n  url:\\n    ioc-paas: http://ioc-paas-svc.ioc-platform:8080\\n    # 推送智能API查询接口信息到网关平台\\n    iocpaas-syncCustomApi: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi\\n    # 网关平台-获取API凭证\\n    iocpaas-CustomApiCredential: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/getCustomApiCredential\\n    # 通过token获取token用户信息\\n    iocpaas-token-user-get: ${iocpaas.url.ioc-paas}/certificate/api/spApiCredential/decodeToken\\n    # 获取网关代理地址\\n    gateway-ipport: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/getKongProxy\\n    # 根据token获取用户信息\\n    iocpaas-decodeToken: ${iocpaas.url.ioc-paas}/certificate/api/spApiCredential/decodeToken\\n    # 同步删除网关API接口\\n    sync-deleteApi: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/{moduleType}/{customApiId}\\n    # 获取网关API凭证和aes秘钥和偏移量\\n    iocpass-spDlResJwt: ${iocpaas.url.ioc-paas}/certificate/spDlResJwt/{resourceCode}\\n    # 同步更新第三方API的局与科室信息\\n    gateway-syncCustomApiDept: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApiDept\\n    # api共享到市场\\n    iocpass-api-publish: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/publish\\n    # api从市场下架\\n    iocpass-api-unpublish: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/unpublish\\n    # 推送第三方接口类型的智能API查询接口信息到网关平台\\n    iocpaas-Regist-ThirdPartyApi: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/registThirdPartyApi\\n    # 设置智能API查询接口的调用频次(接口限流)\\n    iocpaas-SyncCustom-ApiRateLimit: ${iocpaas.url.ioc-paas}/gateway/apis/spInstanceApi/syncCustomApi/rateLimit\\n  datalake-url:\\n    # 数据湖的网关地址\\n    gateway-url: https://19.104.50.204\\n    gateway-api-url: https://19.104.50.204\\n    #gateway-agent-path中第一个参数\\n    dmp: dmp\\n    # 网关代理的路径\\n    gateway-agent-path: /${iocpaas.datalake-url.dmp}/{0}\\n    # 网关代理的前端代理路径\\n    gateway-agent-web-path: /${iocpaas.datalake-url.dmp}/{0}/datalakeweb\\n    # 第三方接口的网关代理的路径,不需要加前端代理\\n    gateway-agent-thirdparty-path: /${iocpaas.datalake-url.dmp}/{0}\\n    # 推送目录分类/标签关系到主湖的网关地址\\n    gateway-relation-url: https://19.104.50.204\\n# 汇聚平台\\ndts:\\n  integration:\\n    # 数据源相关\\n    datasource:\\n      url: http://ioc-dts-integrat-svc.ioc-platform.svc:8080\\n      # 根据数据库类型， 查询数据库\\n      search: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/search?\\n      # 获取标准库表的记录数据\\n      get-standard-tableRows: ${dts.integration.datasource.url}/dts/standard/queryAllData\\n      #更新资源目录挂载数据量与归集库关系\\n      update-resource-link: ${dts.integration.datasource.url}/dts/DtsDataAssetTableName/updateDtsDataassetItem\\n      # 获取数据源项目系统信息\\n      get-project-system: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/ext/getProjectAndSystemMessageBatch\\n      # 获取数据源详情\\n      get-dataSource-detail: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/ext/detail\\n      # 获取数据源表信息\\n      get-dataSource-table: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/ext/getDatasourceAndTableMessage\\n      # 根据数据库， 查询表\\n      get-table-list: ${dts.integration.datasource.url}/dts/integration/dataLake/queryTableAndViewList?\\n      # 根据表， 查询字段\\n      get-column-list: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getColumnList?\\n      # 统计表的数据量（select count(1) from table）\\n      count-by-table: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getTableDataRows?\\n      # 备库数据资产统计结果\\n      result-search: ${dts.integration.datasource.url}/dts/integration/statistic/dtsStatisticsResult/search?\\n      # 根据资源目录编码获取任务信息\\n      get-task-info: ${dts.integration.datasource.url}/dts/dtsSyncJob/getDtsJobByResourceCode?\\n      # 根据数据源ID和表名，分页查询表数据\\n      query-table-data: ${dts.integration.datasource.url}/dts/integration/dataLake/findTableData?\\n      # 通过数据源ID获取加密后的JDBC链接信息\\n      get-dataSource-connInfo: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/getById/{id}\\n      # 获取数据源表结构、数据\\n      get-dataSource-table-detail: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/queryTable\\n      # 查询用户资源是否有数据推送\\n      data-push-job-exists: ${dts.integration.datasource.url}/dts/integration/dataPush/getJobExists\\n      # 查询资源订阅库表是否存在数据推送任务 bool\\n      data-push-job-subtable-exists: ${dts.integration.datasource.url}/dts/integration/dataPush/tableExist\\n      # 根据表名获取时序值本源值(数字)\\n      query-doSeqNumber: ${dts.integration.datasource.url}/dts/integration/dtsTableSeq/doSeqNumber\\n      # 根据表名更新时序数\\n      update-doSeqNumber: ${dts.integration.datasource.url}/dts/integration/dtsTableSeq/updateSeq\\n      # 获取库表的数据,数据服务的查询数据接口使用的\\n      post-queryDataToGovernance: ${dts.integration.datasource.url}/dts/integration/dtsDatasource/ext/queryDataToGovernance\\n      #新增归集库与资源目录关系\\n      add-resource-link: ${dts.integration.datasource.url}/dts/DtsDataAssetTableName/saveTableNameToCollectionDB\\n      # 根据id获取系统信息\\n      search-dts-system: ${dts.integration.datasource.url}/dts/integration/system/searchDtsSystem\\n      # 根据id获取系统信息\\n      data-push-province-stop: ${dts.integration.datasource.url}/dts/integration/dataPush/province/stop/\\n    # 启动省推送同步任务\\n      data-push-province-start: ${dts.integration.datasource.url}/dts/integration/dataPush/province/start/\\n      # 根据资源目录ID查询增量同步任务信息\\n      queryJobInfo: ${dts.integration.datasource.url}/dts/dtsSyncJob/queryJobInfo\\n    # 站内信相关\\n    message:\\n      # 保存站内信\\n      save-internal-message: ${dts.integration.datasource.url}/dts/integration/dtsMessage\\n    # 任务相关\\n    job:\\n      save: ${dts.integration.datasource.url}/dts/dtsSyncJob/resouce/mount\\n\\n\\nkafka:\\n  topic1: datalake-topic1 #kafka事件发布\\n  topic2: datalake-topic2 #kafka事件处理\\n\\n# 是否本地开发环境\\ndev:\\n  devFlag: false\\n\\n#RabbitMQ消息存活时间:一周,暂时不设置\\n# RabbitMQ组件的使用帮助类配置信息\\nrabbitmqhelp:\\n  base:\\n    # mq是否注册\\n    rabbitmq-signIn: true\\n    # 管理端（政数局）的服务名称的缩写\\n    admin-service-short-name: DGS060\\n    # 当前服务是否是管理端\\n    current-service-is-Admin: true\\n    # 当前服务名称的缩写 东莞市政务服务数据管理局 DGS060\\n    current-service-short-name: DGS060\\n    rabbitmq-queue-prefix: prod\\n  apiservice:\\n    datalake:\\n      # 调用主湖下面的admin服务的接口\\n      ioc-admin-url: http://ioc-admin-svc.ioc-platform:8080\\n      # 判断顶级部门编号是否是租户\\n      get-istenant: ${rabbitmqhelp.apiservice.datalake.ioc-admin-url}/admin/sys/sysSubSite/istenant/\\n    dts:\\n      url: http://ioc-dts-integrat-svc:8080\\n      # 获取资源目录的数据同步详情，用于全市共享\\n      get-resouce-syncInfo: ${rabbitmqhelp.apiservice.dts.url}/dts/dtsSyncJob/resouce/syncInfo\\n      # 资源目录上线的数据同步\\n      post-resouce-onLine: ${rabbitmqhelp.apiservice.dts.url}/dts/dtsSyncJob/resouce/onLine\\n      # 资源目录订阅的数据同步\\n      post-resouce-subscribe: ${rabbitmqhelp.apiservice.dts.url}/dts/dtsSyncJob/resouce/subscribe\\n      # 资源目录 更新/停更\\n      post-resouce_syncUpdateOrStop: ${rabbitmqhelp.apiservice.dts.u