ive: 600\\n      min-idle: 1\\n      max-wait: 20000 #配置获取连接等待超时的时间\\n      pool-prepared-statements: false\\n      max-pool-prepared-statement-per-connection-size: 20\\n      max-open-prepared-statements: 20 #和上面的等价\\n      validation-query: SELECT \\\'x\\\' FROM DUAL\\n      validation-query-timeout: 1\\n      test-on-borrow: false\\n      test-on-return: false\\n      test-while-idle: true\\n      filters: stat\\n\\n  redis:\\n    # redis数据库索引（默认为0），我们使用索引为3的数据库，避免和其他数据库冲突\\n    database: 0\\n    # redis服务器地址（默认为localhost）\\n    host: 19.104.50.204\\n    #host: 127.0.0.1\\n    # redis端口（默认为6379）\\n    port: 6379\\n    # redis访问密码（默认为空）\\n    password: ENC(18y0O78BQc5x3eqduciALjZjw5P80+Y4)\\n    # redis连接超时时间（单位为毫秒）\\n    timeout: 10000\\n    # redis连接池配置\\n    jedis:\\n      pool:\\n        # 最大可用连接数（默认为8，负数表示无限）\\n        max-active: 30\\n        # 最大空闲连接数（默认为8，负数表示无限）\\n        max-idle: 8\\n        # 最小空闲连接数（默认为0，该值只有为正数才有作用）\\n        min-idle: 0\\n        # 从连接池中获取连接最大等待时间（默认为-1，单位为毫秒，负数表示无限）\\n        max-wait: 5000\\n\\n  servlet:\\n    multipart:\\n      max-file-size: 50MB\\n      max-request-size: 100MB\\n\\n  rabbitmq:\\n    addresses: 19.104.53.216:5672,19.104.53.217:5672,19.104.53.219:5672\\n    username: mqadmin\\n    password: ioc@rabbitmq_Cluster\\n    virtual-host: /\\n    #开启消息发送确认\\n    publisher-confirms: true\\n    #开启ReturnCallback,如果消息从交换器发送到对应队列失败时触发\\n    publisher-returns: true\\n    # 是否启动监听\\n    startListen: true\\n    listener:\\n      simple:\\n        #消费者接收确认\\n        acknowledge-mode: manual\\n        #消费者一次接收多少条消息\\n        prefetch: 1\\n        missing-queues-fatal: false\\n\\n#消息存活时间:一分钟\\nrabbitmqMsg:\\n  message-ttl: 604800000\\nrabbitmqhelp: \\n  base: \\n    #当前服务是否是管理端\\n    current-service-is-Admin: true\\n#计划任务配置\\nschedule:\\n  execution:\\n    waitqueue: 0/5 * * * * ?\\n  sys:\\n    enable: usplatform\\n    oa-user-synchron: 0 1 0 * * ? #同步oa用户信息\\n    oa-org-synchron: 0 0 1 * * ? #同步oa机构信息\\n    sub-site-user-sync: 0 0 2 * * ?   #同步租户用户信息\\n    usplatform-org-synchron: 0 0 1 * * ? #同步统一架构机构信息\\n    usplatform-user-synchron: 0 0 4 * * ? #同步统一架构用户信息\\n  service:\\n    kong: 0/1 * * * * ?\\n    paas: 0/2 * * * * ?\\n  expired:\\n    catalog: 0 0 0 * * ? #处理服务订阅过期\\n    api: 0 0 0 12 12 ? #处理API订阅过期\\n  api:\\n    heat: 0 0 3 21 7 ? #API热度统计，03、13点各跑一次\\n    statistic: #API统计模块\\n      deptdetails: 0 0/30 * * * ? # 每半小时执行一次\\n      apidetails: 0 0 0/3 * * ? # 每3小时执行一次\\n      apidaydetails: 0 0 6 * * ? # 每5分钟执行一次\\n      dmz: 0 0 0/3 * * ? # 每3小时执行一次\\n      dmzday: 0 0 6 * * ? # 每5分钟执行一次\\n      dmzdayFix: 0 05 18 09 9 ?\\n    operate: #API运营模块\\n      health-check: 0 */7 * * * ? # 网关服务健康检查,每7分钟执行一次,7分钟是经过推算后的时间\\n      health-check-log: 0 */1 * * * ? # 日志服务健康检查,每1分钟执行一次\\n      api-invoke-info: 0 */3 * * * ? # 统计API调用次数,失败次数,平均响应时间,每3分钟执行一次\\n      push-frequency: 0/10 * * * * ? # 推送频率,每10秒一次\\n\\noauth2:\\n  oauth2Url: http://tyrz.dg/borosoft-oauth2-server\\n  accessTokenUrl: http://tyrz.dg/borosoft-oauth2-server/accessToken\\n  userInfoUrl: http://tyrz.dg/borosoft-oauth2-server/v1/openapi/userInfo\\n  client_id: 2642b7b37f6848b397e1812affbee479\\n  redirect_uri: not_used\\n  scope: user\\n  client_secret: BFWUZZNJFI\\n  homePageUrl: not_used\\n  account: dsjdniocg\\n  uniqueMark: 4d4372d8fccf4d94b6d4f944ec6e5cdb\\n\\nusplatform:\\n  auth:\\n    type: usplatform #对接认证类型：OA:OA系统；usplatform:统一认证\\n    platform-type: datalake #项目类型：datalake:数据湖；dmp:数据管理平台\\n    platform-code: DGS060 #政数局\\n    server: https://passport.dg.cn #认证服务地址\\n    openid-configuration-uri: ${usplatform.auth.server}/.well-known/openid-configuration\\n    jwks-uri: ${usplatform.auth.server}/.well-known/openid-configuration/jwks #确认Server授权验证\\n    authorization-uri: ${usplatform.auth.server}/connect/authorize #获取授权码code\\n    token-uri: ${usplatform.auth.server}/connect/token #通过授权码code，获取用户访问令牌token\\n    userinfo-uri: ${usplatform.auth.server}/connect/userinfo #通过用户访问令牌 token，获取登录用户当前的身份信息\\n    end-session