\\n        test-on-return: true\\n        filters: stat,slf4j\\n  mail:\\n    host: smtp.163.com\\n    username: dgd47keji@163.com #发送方的邮箱\\n    password: d47888 #授权码\\n    default-encoding: UTF-8\\n    properties:\\n      mail:\\n        smtp:\\n          auth: true # 设置是否需要认证，如果为true,那么用户名和密码就必须的， 如果设置false，可以不设置用户名和密码，当然也得看你的对接的平台是否支持无密码进行访问的。\\n          starttls:\\n            enable: true # STARTTLS[1]  是对纯文本通信协议的扩展。它提供一种方式将纯文本连接升级为加密连接（TLS或SSL），而不是另外使用一个端口作加密通信。\\n            required: true\\n          socketFactory:\\n            class: javax.net.ssl.SSLSocketFactory\\n            port: 465 #阿里云ecs禁用了25端口,所以这里必须用\\nscheduled:\\n  brake-machine: 0/30 * * * * ?\\n  vaccination: 0 5 1 * * ? #疫苗接种\\n  gyh-all: 0 0 2 * * ?\\n  gyh-append: 0 0 0/2 * * ?\\n  fever: 0 11 10 1 1 ?\\n  fever-fq: 0 49 10 1 1 ?\\n  fever-mq: 0 50 10 1 1 ?\\n  fever2: 0 0 4 1 1 ?\\n  fever-fq2: 0 2 4 1 1 ?\\n  fever-mq2: 0 4 4 1 1 ?\\n  health-recognize: 0 7 20 2 1 ?\\n  dgt-health-code: 0 0 5,14 * * ?\\n  dgt-health-code-cancel: 0 50 17 9 6 ?\\n  health-code: 0 55 17 9 6 ?\\n  health-red-code: 0 7 20 2 1 ?\\n  health-code-cancel: 0 0 8 19 6 ?\\n  fq-health-code: 0 7 20 2 1 ?\\n  fq-health-red-code: 0 7 20 2 1 ?\\n  fq-health-code-cancel: 0 7 20 2 1 ?\\n  mq-health-code: 0 7 20 2 1 ?\\n  mq-health-red-code: 0 7 20 2 1 ?\\n  mq-health-code-cancel: 0 7 20 2 1 ?\\n  fq-driver-data-match: 0 */10 * * * ? # 疫情入境司机数据匹配,每10分钟执行一次\\n  fq-tpr-record-match: 0 31 * ? * * # 核酸记录数据更新,每小时的第31分执行\\n  fq-tpr-record-everyday-match: 0 0 0 */1 * ? # 核酸记录数据更新,每天凌晨0点执行一次\\n  fq-hsjc:  0 55 9 15 12 ? # 每8小时执行一次\\n  fq-hsjc-hf: 0 55 9 15 12 ?  # 每小时执行一次\\n\\njob:\\n  strategy: all\\n  offset: 0\\n  thread-size: 10\\n  vaccinationThread: 3\\n  vaccination-sql: \"SELECT * FROM (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID_CARD,t.MAIN_PEOPLE_TYPE,t.VACCINATE from YQ_RYXX t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where ID_CARD IS NOT NULL AND (VACCINATE<>\\\'已接种第二剂\\\' OR VACCINATE IS NULL)\"\\n  fever-sql: \"SELECT * FROM (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_ZJHM,t.DRUG_DATA from YW_DGS_SJYJ_SSJKWJ_0426_FEVER t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where DGS_ZJHM is not null and DRUG_DATA is null\"\\n  fq-fever-sql: \"SELECT * from (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_FQSFZ,t.FQ_DRUG_DATA from YW_DGS_SJYJ_SSJKWJ_0426_FEVER t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where DGS_FQSFZ is not null and FQ_DRUG_DATA is null\"\\n  mq-fever-sql: \"SELECT * from (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_MQSFZ,t.MQ_DRUG_DATA from YW_DGS_SJYJ_SSJKWJ_0426_FEVER t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where DGS_MQSFZ is not null and MQ_DRUG_DATA is null\"\\n  health-recognize-sql: \"SELECT * from (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.QUERY_ID_CARD,t.HEALTH_STATUS,t.GJ_HEALTH_DATA from YQ_HEALTH_STATE_QUERY_LOG_RECOGNIZE t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where QUERY_ID_CARD is not null and GJ_HEALTH_DATA is null\"\\n  dgt-health-code-sql: \"SELECT * from (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.NAME NAME,t.ZJH ZJH,t.YUEKANMA_STATE STATE,t.UPDATE_TIME UPDATE_TIME from dg_dgt_card t) tt where rownum<%s) ttt where ttt.rowno>%s) where zjh is not null\"\\n  health-code-sql: \"SELECT * FROM (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_ZJHM,t.SS_HEALTH_CODE,t.SS_HEALTH_CODE_UPDATE_TIME from YW_DGS_SJYJ_SSJKWJ_0426 t) tt where ROWNUM<%s) ttt where ttt.rowno>%s) where DGS_ZJHM is not null\"\\n  health-red-code-sql: \"SELECT * FROM (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_ZJHM,t.SS_HEALTH_CODE,t.SS_HEALTH_CODE_UPDATE_TIME from YW_DGS_SJYJ_SSJKWJ_0426 t where t.SS_HEALTH_CODE=\\\'1\\\') tt where ROWNUM<%s) ttt where ttt.rowno>%s) where DGS_ZJHM is not null\"\\n  fq-health-code-sql: \"SELECT * from (SELECT * FROM (SELECT ROWNUM as rowno,tt.* FROM (SELECT t.ID,t.DGS_FQSFZ,t.FQ_